import React from 'react';
import PropTypes from 'prop-types';

const RedBox = ({ leftText, rightText }) => {
  const boxStyle = {
    margin: '0',
    pading: '0',
    display: 'flex',
    minHeight: '100vh', 
    flex: '1', 

    justifyContent: 'space-between',

  };

  return (
    <div style={boxStyle}>
      <div>{leftText}</div>
      <div>{rightText}</div>
    </div>
  );
};

RedBox.propTypes = {
  leftText: PropTypes.string,
  rightText: PropTypes.string,
};

RedBox.defaultProps = {
  leftText: 'Net Worth',
  rightText: '$0',
};

export default RedBox;
